window.bookSummaryJSON = "<p>Sam Meeko never thought that he’d ever get a superpower, especially one that allows him to smell everything.&nbsp;<i>Everything.&nbsp;</i>With his unconventional power, Sam joins forces with a group of women hellbent on getting to the bottom of a countrywide conspiracy. It’s going to take some thinking outside the box, and when that doesn’t work, Sam and his group might need to tear the walls down.&nbsp;</p>"; 
